column8:
☆コーディネートにスタイリッシュなアクセントを添えてくれるハット。通気性のいいブレード素材を使用し、汗止めには吸汗速乾、抗菌防臭素材を使用。リボンにはオリジナルグラフィックプリントを使用した2色、ソリッドの2色の2タイプで展開。サイドにEllipseロゴの刺繍。<BR><BR>

素材：指定外繊維(紙100％)<BR><BR> 

機能：吸汗速乾、抗菌防臭<BR><BR>

サイズ：ワンサイズ(約58cm) <BR><BR>

製造国：中国<BR><BR> 

※こちらの商品は実店舗でも共有在庫にて販売しております。 <BR>売り切れの場合、手動にて在庫変更をしております為、時間差にて売り切れになる場合がございます。 
